import React from "react";
import ReactDOM from "react-dom";

class SocialMediaIcon extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="container">
        <i class="fas fa-hashtag"></i>
      </div>
    );
  }
}
